import styled from "@emotion/styled";
import { useState } from "react";
import { CardContentT } from "../typesTS/CardContent";

// import styled from "@emotion/styled/macro";

export default function SmallCard({ card }: { card: CardContentT }) {
  // styles

  const Container = styled.div`
    margin-top: 50px;
    margin-left: 150px;
    display: grid;
    width: 278px;
    grid-template-rows: 50px 55px;
    grid-template-columns: 50px 194px;
    background-color: #fff;
  `;
  const CardPic = styled.img`
    grid-column-start: 1;
    grid-column-end: 2;
    grid-row-start: 1;
    grid-row-end: 3;
    margin-left: 20px;
    margin-top: 34px;
  `;
  const Label = styled.span`
    font-family: "Jost", sans-serif;
    font-size: 13px;
    color: rgba(0, 0, 0, 0.5);
    grid-column-start: 2;
    grid-column-end: 3;
    grid-row-start: 1;
    grid-row-end: 2;
    margin-top: 25px;
    margin-left: 15px;
  `;
  const Text = styled.span`
    font-family: "Jost", sans-serif;
    font-size: 13px;
  `;
  // functionality
  return (
    <Container>
      <CardPic src={card.picAdress}></CardPic>
      <Label>{card.label}</Label>
      <Text>{card.text}</Text>
    </Container>
  );
}
